function closeFormAndRemove(n){$("#"+n).hide();$(".modal-backdrop").hide();$(".modal-backdrop").remove();$("body").removeClass()}function getPathName(){return window.location.host}function onFail(n){var i=n.status,t=new String(n.responseText);console.log(i);t=t.split("<title>")[1].split("<\/title>")[0].split("-")[2];console.log(t);onFailCatched(i,t)}function onFailCatched(n,t){switch(n){case 400:statusResponse("warning",n,t,4e3);break;case 403:window.history.go(-window.history.length);window.location.reload(!0);break;case 404:statusResponse("warning",n,t,4e3);break;case 406:statusResponse("warning",n,t,4e3);window.location.reload(!0);break;default:statusResponse("danger",n,t,4e3)}}function statusResponse(n,t,i,r){var u='<div class="alert alert-'+n+' alert-dismissible"><img src = "'+getPathName();switch(n){case"success":u+="/root/images/success.png";break;case"warning":u+="/root/images/warning.png";break;case"danger":u+="/root/images/danger.png";break;case"info":default:u+="/root/images/info.png"}u+='" height = "25" width = "25" alt = "status" ><strong> '+t+"<\/strong> "+i+"<\/div> ";$("div.status_alert").html(u);$(".alert").alert();window.setTimeout(function(){$(".alert").fadeTo(1e3,0).slideUp(1e3,function(){$(this).remove()})},r)}